import React, { Component, useEffect, useState } from 'react'
import project_service from '../../services/project_service'
import { Box, Button, Container, Dialog, Divider, IconButton, Input, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TablePagination, TableRow, Typography } from '@mui/material'
import { Delete, Edit, ViewCarousel, ViewComfy, ViewInAr, ViewStream, Visibility } from '@mui/icons-material'
import { useNavigate, useParams } from 'react-router-dom'
import gtfs_service from '../../services/gtfs_service'
import { DashboardLayout } from '../dashboard/dashboard-layout'
import Head from 'next/head'

const Gtfs_Details = () => {

    let navigate = useNavigate();

    const { id } = useParams()

    const [gtfs, setGtfs] = useState([])
    const [routes, setRoutes] = useState([])
    const [calendars, setCalendars] = useState([])
    const [shapes, setShapes] = useState([])
    const [trips, setTrips] = useState([])
    const [calendarDates, setCalendarDates] = useState([])
    const [agencies, setAgencies] = useState([])
    const [stops, setStops] = useState([])
    const [stopTimes, setStopTimes] = useState([])
    const [open, setOpen] = useState(false)



    const handleClose = () => {
        setOpen(false)
    }




    useEffect(() => {
        gtfs_service.getGtfsById(id).then((response) => {
            setGtfs(response.data.gtfs)
            setRoutes(response.data.routes)
            setCalendars(response.data.calendars)
            setShapes(response.data.shapes)
            setTrips(response.data.trips)
            setCalendarDates(response.data.calendarDates)
            setAgencies(response.data.agencies)
            setStops(response.data.stops)
            setStopTimes(response.data.stopTimes)
        }, error => {
            console.log(error)
        })
    }, [])


    return (
        <DashboardLayout>
            <Head>
                <title>GTFS - </title>
            </Head>
            <Box component="main" sx={{ flexGrow: 1, py: 5 }}>
                <Container maxWidth={false}>
                    <div>
                        <Box
                            sx={{
                                alignItems: 'center',
                                display: 'flex',
                                justifyContent: 'space-between',
                                flexWrap: 'wrap',
                                m: -1
                            }}>
                            <Typography sx={{ m: 1 }} variant="h4">
                                GTFS - {id}
                            </Typography>

                        </Box>

                        <Typography sx={{ m: 1 }} variant="h4">
                            Agencias
                        </Typography>

                        <Paper
                            style={{ borderRadius: "25px" }}
                            sx={{ width: "100%", mb: 2, mt: 2 }}
                            elevation={10}
                        >
                            <TableContainer sx={{ minWidth: 128 }} style={{ borderRadius: "25px" }}>
                                <Table>
                                    <TableHead>
                                        <TableRow>
                                            <TableCell>ID</TableCell>
                                            <TableCell>agency_id</TableCell>
                                            <TableCell>agency_name</TableCell>
                                            <TableCell>agency_url</TableCell>
                                            <TableCell>agency_timezone</TableCell>
                                        </TableRow>
                                    </TableHead>


                                </Table>
                                <TableBody>
                                    {agencies.map((agency) => (
                                        <TableRow
                                            hover
                                            key={agency.id}
                                        >
                                            <TableCell>{agency.id}</TableCell>
                                            <TableCell>{agency.agencyId}</TableCell>
                                            <TableCell>{agency.agencyId}</TableCell>
                                            <TableCell>{agency.agency_name}</TableCell>
                                            <TableCell>{agency.agency_url}</TableCell>
                                            <TableCell>{agency.agency_timezone}</TableCell>
                                        </TableRow>
                                    ))}
                                </TableBody>
                            </TableContainer>

                        </Paper>
                    </div >
                </Container>
            </Box>
        </DashboardLayout >
    )
}

export default Gtfs_Details
